import React from 'react';
import { Link } from 'react-router-dom';
import './Styles/Navbar.css';
import Swal from 'sweetalert2';

const token = localStorage.getItem("token");
const user = JSON.parse(localStorage.getItem("user"));

const AlertDef = (text) => {
    Swal.fire({
        title: '¡Aviso de la Pokédex!',
        text: text,
        imageUrl: 'ditto.gif',
        imageWidth: 150,
        imageHeight: 150,
        imageAlt: 'Imagen de ditto',
        timer: 2500,
        showConfirmButton: false,
        timerProgressBar: true,
        background: '#90c4d0',
        color: '#000000',
    });
};

const AlertErr = (text) => {
    Swal.fire({
        title: '¡Se ha escapado!',
        text: text,
        imageUrl: 'ditto.gif',
        imageWidth: 150,
        imageHeight: 150,
        imageAlt: 'Imagen de ditto',
        timer: 2500,
        showConfirmButton: false,
        timerProgressBar: true,
        background: '#ab3232',
        color: '#000000',
    });
};

const AlertTrue = (text) => {
    Swal.fire({
        title: '¡Capturado!',
        text: text,
        imageUrl: 'ditto.gif',
        imageWidth: 150,
        imageHeight: 150,
        imageAlt: 'Imagen de ditto',
        timer: 2000,
        showConfirmButton: false,
        timerProgressBar: true,
        background: '#3ea83d',
        color: '#000000',
    });
};

const Navbar = () => {
    return (
        <header className="navbar">
            <h1 className="sidebar-title">
                Pokémon<br />Training <strong>Zone</strong>
            </h1>

            <div className="search-bar">
                <input type="text" placeholder="Buscar..." className="search-input" />
                <Link to="/Pkdx"><button className="search-button"><img className="searchimg" src="/search.png" /></button></Link>
            </div>
            <div className="header-buttons">
                <Link to="/Perfil"><button className="btn-profile">Mi perfil</button></Link>
                <Link to="/"><button className="btn-logout">Cerrar Sesión</button></Link>
            </div>
        </header>
    );
};

export default Navbar;
